import ExpenseItem from "./ExpenseItem";

function ExpenseItemRoot(props) {

  return (
    <div>
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      ></ExpenseItem>

    </div>
  );
}

export default ExpenseItemRoot;
